81231;instagram;2019-01-11 03:57:20;FALSE;so deeply proud of my mama for the work she has done and for all that she is creating 🍃 today she launched a circle series for moms of survivors, be it of mental health, trauma, etc. she is creating space for supporting mama’s to be held in the nurturing support they so need and deserve 💜 the journey that my mom and i have shared in the past few years is so profoundly special. i witnessed my mom awaken to her worth, depth and calling, after taking a deep descent into shadow. this descent was largely propelled by my own experience of sexual assault & struggle in survival. the fact that my mom held me with such strength, while her own world felt so shaken, leaves me with a gratitude and admiration of motherhood that is beyond words. mothers deserve the deepest honour and i am so in awe of the light @listentoyourtruth has created out of such darkness. thank you for being my grounding rock and my loving river 🌊 if you’re a mama looking for spirit-based support alongside all of the supporting you do, reach out to barbieliss@hotmail.com ! 📷 photo by @womynwithheart;;en;;@listentoyourtruth, @womynwithheart;;;;0;;marleeliss;Marlee Liss;;0;False;16;0;0;143;https://instagram.fyvr3-1.fna.fbcdn.net/vp/6fba282fc2e1ef95d566e99a6e429d30/5D1C39E4/t51.2885-15/e35/47694943_233521850873314_1697262878262523700_n.jpg?_nc_ht=instagram.fyvr3-1.fna.fbcdn.net;0;FALSE;FALSE;FALSE;english;so deeply proud of my mama for the work she has done and for all that she is creating 🍃 today she launched a circle series for moms of survivors, be it of mental health, trauma, etc. she is creating space for supporting mama’s to be held in the nurturing support they so need and deserve 💜 the journey that my mom and i have shared in the past few years is so profoundly special. i witnessed my mom awaken to her worth, depth and calling, after taking a deep descent into shadow. this descent was largely propelled by my own experience of sexual assault & struggle in survi